        // parsing and collecting nodes and edges from the python
        nodes = new vis.DataSet([{"color": "#377eb8", "id": "1980-1990_stryk_109", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDen hadde da et loddrett f all p\u00e5 29 m og nedenfor et\u003cbr\u003e\u003cb\u003estryk\u003c/b\u003e p\u00e5 5 m. Bind VI B\u2014 16 Bekkalunfossen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_109\u003cbr\u003etype: usage\u003c/p\u003e", "x": -368.26091305523886, "y": 635.1381452185974}, {"color": "#377eb8", "id": "1980-1990_stryk_55", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eFra Imsavassdragets lavestliggende vatn renner elva med\u003cbr\u003eforholdsvis jevnt fall 43 km til utl\u00f8pet i Glomma. Eld\u00e5a og Trya g\u00e5r\u003cbr\u003esom striere \u003cb\u003estryk\u003c/b\u003e og sistnevnte danner fossen Storfallet.\u003cbr\u003eInnsj\u00f8arealet utgj\u00f8r mindre enn 1% av hele nedb\u00f8rfeltet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_55\u003cbr\u003etype: usage\u003c/p\u003e", "x": 5.472055794158176, "y": 504.76122646101203}, {"color": "#377eb8", "id": "1980-1990_stryk_78", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eHerfr\u00e5 renner elva i fosser og \u003cb\u003estryk\u003c/b\u003e uten \u00e5 g\u00e5 gjennom\u003cbr\u003eflere vatn. Vatna er relativt grunne (18 \u2014 28 m).\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_78\u003cbr\u003etype: usage\u003c/p\u003e", "x": -132.42188994376593, "y": 317.1823025290672}, {"color": "#377eb8", "id": "1980-1990_stryk_38", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMellom den gamle og nye Hagabrua g\u00e5r elva i \u003cb\u003estryk\u003c/b\u003e med\u003cbr\u003eca. 3 m. fallh\u00f8yde.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_38\u003cbr\u003etype: usage\u003c/p\u003e", "x": -493.09743095436477, "y": 542.6314579867418}, {"color": "#377eb8", "id": "1980-1990_stryk_12", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eElva vekslar mellom slake parti, ofte med store myromr\u00e5de, og\u003cbr\u003ekortare parti med fossar og \u003cb\u003estryk\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_12\u003cbr\u003etype: usage\u003c/p\u003e", "x": -229.92718826858678, "y": 696.5377477668306}, {"color": "#377eb8", "id": "1980-1990_stryk_17", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ePadlingen foreg\u00e5r oftest i \u003cb\u003estryk\u003c/b\u003e eller i elver dominert\u003cbr\u003eav stryk.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_17\u003cbr\u003etype: usage\u003c/p\u003e", "x": -319.81746466787234, "y": 467.41576166963483}, {"color": "#377eb8", "id": "1980-1990_stryk_42", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eAtnasj\u00f8my- Varige eller sesongpregete sterke reduksjoner i\u003cbr\u003eelvas vannf\u00f8ring hindrer vandring av fisk, t\u00f8rrlegger gyte- og\u003cbr\u003eoppvekstplasser og reduserer formeringen. Den naere tilpasning hos\u003cbr\u003ef.eks. laks og sj\u00f8aure til vannf\u00f8ring og temperatur som Vilt og\u003cbr\u003eferskvannsfisk og vassdragsvern har betydning for fiskens gang i\u003cbr\u003eelvene og for passering av\u003cb\u003e stry\u003c/b\u003ek og fosser, blir ved regulering\u003cbr\u003ebrakt ut av balanse og vil ofte \u00f8delegge vandringsm\u00f8nsteret\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_42\u003cbr\u003etype: usage\u003c/p\u003e", "x": -524.6128683349049, "y": 396.36511916763453}, {"color": "#377eb8", "id": "1980-1990_stryk_90", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eBotnbreer har vaert aktive ogs\u00e5 etter den tid. Elvel\u00f8pene er\u003cbr\u003evarierte fra\u003cb\u003e stry\u003c/b\u003ek og fosser i trange gjel til langstrakte\u003cbr\u003erolige loner\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_90\u003cbr\u003etype: usage\u003c/p\u003e", "x": -149.09872302380262, "y": 578.3229382008047}, {"color": "#377eb8", "id": "1980-1990_stryk_71", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eElva har ingen markerte fall, men lange strekninger av l\u00f8pet\u003cbr\u003eg\u00e5r i \u003cb\u003estryk\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_71\u003cbr\u003etype: usage\u003c/p\u003e", "x": -301.9976231147323, "y": 233.43928567636033}, {"color": "#377eb8", "id": "1980-1990_stryk_37", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eHan var 42 og Kona Olme Embretsd. 45 \u00e5r. De hadde 3 barn,\u003cbr\u003eIngeb\u00f8r 11, Peder 9 og Olava 5 \u00e5r. Ovenfor plassen Kvernhusdalen eller\u003cbr\u003e\u00d8vre Mastekastet g\u00e5r Holme vannsbekken i et sterkere\u003cbr\u003e\u003cb\u003estryk\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_37\u003cbr\u003etype: usage\u003c/p\u003e", "x": -391.0596216861089, "y": 348.34703856670825}, {"color": "#377eb8", "id": "1980-1990_stryk_57", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eNedenfor Vangsvatnet tar Vosso opp endel mindre sideelver f\u00f8r\u003cbr\u003edet via Evangervatn renner ut i Veaf jorden. Elva renner her i\u003cbr\u003e\u003cb\u003estryk\u003c/b\u003e med stille partier innimellom. I dette partiet er\u003cbr\u003edalf\u00f8ret trangt og med bratte dalsider.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_stryk_57\u003cbr\u003etype: usage\u003c/p\u003e", "x": -186.0810223093334, "y": 444.2801509738661}, {"color": "#ff7f00", "id": "2012-2019_stryk_705", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eGa oppholdstillatelse til vitne Lime-skiltene m\u00e5 ned for \u00e5 f\u00e5\u003cbr\u003evarer Lime-butikker fikk \u003cb\u003estryk\u003c/b\u003e fra revisor\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_stryk_705\u003cbr\u003etype: usage\u003c/p\u003e", "x": 561.4461873826174, "y": -600.1005753266564}, {"color": "#ff7f00", "id": "2012-2019_stryk_95", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI forrige runde var det Sandviken som fikk \u003cb\u003estryk\u003c/b\u003e med\u003cbr\u003e5-3. Denne gangen var det en Julie Adser\u00f8-dobbel som s\u00f8rget for at\u003cbr\u003eKattem ledet 2-0. F\u00f8rst satte hun et straffespark i nettet etter dr\u00f8yt\u003cbr\u003ehalvspilt f\u00f8rste omgang, f\u00f8r hun to minutter f\u00f8r pause doblet\u003cbr\u003eledelsen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_stryk_95\u003cbr\u003etype: usage\u003c/p\u003e", "x": 750.0, "y": -459.2618346980403}, {"color": "#ff7f00", "id": "2012-2019_stryk_274", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen n\u00e5r eksamen naermer seg, vendes situasjonen til det\u003cbr\u003emotsatte. I tillegg til redusert velvaere og negative helsemessige\u003cbr\u003ekonsekvenser kommer redusert prestasjonskvalitet - d\u00e5rligere\u003cbr\u003ekarakterer og \u00f8kt sannsynlighet fo\u003cb\u003er str\u003c/b\u003ey\u003cspan style=\"color:#808080;\"\u003ek.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_stryk_274\u003cbr\u003etype: usage\u003c/p\u003e", "x": 434.26871826623, "y": -294.7378599758935}, {"color": "#ff7f00", "id": "2012-2019_stryk_543", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDette vil vi se naermere p\u00e5 n\u00e5, sier han. N\u00e5r det kommer til de\u003cbr\u003eto produktene som f\u00e5r\u003cb\u003e stry\u003c/b\u003ek i testen, sier Pedersen at de f\u00f8rst\u003cbr\u003eog fremst skal merkes, men at de vil vurdere om de skal fortsette \u00e5\u003cbr\u003eselge dem. - Umiddelbart vil vi merke disse produktene tydelig. Videre\u003cbr\u003evil vi gj\u00f8re en vurdering om vi fortsatt skal tilby disse eller ikke,\u003cbr\u003ehevder han overfor Dinside. - Dette er en deklarasjonstest, ikke en\u003cbr\u003erisikovurdering! I Norge er det Mattilsynet som f\u00f8rer tilsyn med at\u003cbr\u003ekosmetikk omsettes p\u00e5 markedet slik regelverket sier\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_stryk_543\u003cbr\u003etype: usage\u003c/p\u003e", "x": 229.46408120963756, "y": -648.4411564007221}, {"color": "#ff7f00", "id": "2012-2019_stryk_854", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen til ingen nytte. Jarle Aasland Petter Thoresens mannskap\u003cbr\u003etok seg av VIF f\u00f8r Storhamar fikk \u003cb\u003estryk\u003c/b\u003e i finalen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_stryk_854\u003cbr\u003etype: usage\u003c/p\u003e", "x": 304.0439253944442, "y": -334.3931414154367}, {"color": "#ff7f00", "id": "2012-2019_stryk_675", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEn slik rettsanvendelse ville st\u00e5tt til \u003cb\u003estryk\u003c/b\u003e p\u00e5 e
